function transfer(address recipient, uint256 amount) public returns (bool) {
    address sender = _msgSender();

    /* ---------------------------------------------------------- */
    /* Basic sanity checks (mirrors the de-compiled requirements) */
    /* ---------------------------------------------------------- */
    require(sender != address(0),                "ERC20: transfer from the zero address");
    require(recipient != address(0),             "ERC20: transfer to the zero address");
    require(amount > 0,                          "Transfer amount must be greater than zero");
    require(_balances[sender] >= amount,         "ERC20: transfer amount exceeds balance");

    /* ------------------------------------------------------------------ */
    /* Anti-bot transfer-delay (only one purchase per block for a wallet) */
    /* ------------------------------------------------------------------ */
    if (transferDelayEnabled
        && recipient != uniswapV2Pair            /* buy  */
        && sender    != uniswapV2Pair            /* sell */
        && sender    != owner()                 /* owner always exempt */
    ) {
        require(_holderLastTransferBlock[tx.origin] < block.number,
                "_transfer:: Transfer Delay enabled. Only one purchase per block allowed.");
        _holderLastTransferBlock[tx.origin] = block.number;
    }

    /* ----------------------- */
    /* Max-Tx / Max-Wallet     */
    /* ----------------------- */
    if (sender != owner() && recipient != owner()) {
        require(amount <= _maxTxAmount, "Exceeds the _maxTxAmount.");

        if (recipient != uniswapV2Pair) {  /* not a sell, i.e. recipient is taking tokens into wallet */
            require(_balances[recipient] + amount <= _maxWalletSize,
                    "Exceeds the max wallet size.");
        }
    }

    /* ----------------------- */
    /* Determine current taxes */
    /* ----------------------- */
    uint256 taxRate;

    if (recipient == uniswapV2Pair) {                             /* SELL  */
        taxRate = (_buyCount > _reduceSellTaxAt) ? _finalSellTax : _initialSellTax;
    } else if (sender == uniswapV2Pair) {                         /* BUY   */
        taxRate = (_buyCount > _reduceBuyTaxAt)  ? _finalBuyTax  : _initialBuyTax;
        _buyCount++;
    } else {                                                      /* P2P   */
        taxRate = 0;
    }

    uint256 taxAmount = amount * taxRate / 100;
    uint256 transferAmount = amount - taxAmount;

    /* ---------------------------------- */
    /* Move tokens and emit Transfer logs */
    /* ---------------------------------- */
    _balances[sender]    -= amount;
    _balances[recipient] += transferAmount;
    emit Transfer(sender, recipient, transferAmount);

    if (taxAmount > 0) {
        _balances[address(this)] += taxAmount;
        emit Transfer(sender, address(this), taxAmount);
    }

    /* --------------------------- */
    /* Handle automatic tax swap   */
    /* --------------------------- */
    uint256 contractTokenBalance = _balances[address(this)];

    bool canSwap = contractTokenBalance >= _taxSwapThreshold;

    if (
        canSwap &&
        !inSwap &&
        sender != uniswapV2Pair &&
        swapEnabled &&
        _buyCount > _preventSwapBefore
    ) {
        inSwap = true;

        uint256 swapAmount = contractTokenBalance > _maxTaxSwap
            ? _maxTaxSwap
            : contractTokenBalance;

        _swapTokensForEth(swapAmount);

        uint256 contractETHBalance = address(this).balance;
        if (contractETHBalance > 0) {
            _sendETHToFee(contractETHBalance);
        }

        inSwap = false;
    }

    return true;
}

